import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Landing from './components/Landing/index'
import Login from './'

function App() {
  return (
   <Router>
     <Switch>
       <Route exact component={Landing} />
       <Route component = {Login} />
     </Switch>
   </Router>
  );
}

export default App;
